import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom'

import Header from './components/Header'
import Navbar from './components/Navbar'
import Landing from './components/Landing'
import './App.scss';

function App() {
  return (
    <Router>
      <Header />
      <Navbar />
      <Landing />
    </Router>

  );
}

export default App;
